<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Email Header Checker - IT Tamp4n</title>
    <link href="https://cdn.jsdelivr.net/npm/tailwindcss@2.2.19/dist/tailwind.min.css" rel="stylesheet">
    <script src="https://unpkg.com/@dotlottie/player-component@latest/dist/dotlottie-player.mjs" type="module"></script>
    <style>
        .loading {
            display: none;
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 50;
        }
        .header-img {
            width: 100px;
            height: 100px;
        }
    </style>
</head>
<body class="bg-gray-100 flex flex-col min-h-screen">
    <header class="bg-blue-600 p-4 shadow-md text-white">
        <div class="container mx-auto flex items-center">
            <img src="data:image/jpeg;base64," alt="Logo" class="header-img mr-4">
            <h1 class="text-2xl font-bold">Email Header Checker With VirusTotal Integration</h1>
        </div>
    </header>
    <main class="flex-grow">
        <div class="container mx-auto p-4">
            <form id="emailForm" class="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
                <div class="mb-4">
                    <label for="emailHeader" class="block text-gray-700 text-sm font-bold mb-2">Header Email:</label>
                    <textarea id="emailHeader" name="emailHeader" rows="10" class="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"></textarea>
                </div>
                <div class="flex items-center justify-between">
                    <button id="submitBtn" class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="button">
                        Check Email :
                    </button>
                    <button id="clearBtn" class="bg-gray-500 hover:bg-gray-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="button">
                        Clear
                    </button>
                </div>
            </form>
            <div id="result" class="mt-4 text-lg font-bold"></div>
        </div>
    </main>
    <footer class="bg-blue-600 p-4 shadow-md text-white">
        <div class="container mx-auto text-center">
            &copy; 2024 Email Header Checker With VirusTotal Integration - IT Tamp4n. All rights reserved.
        </div>
    </footer>
    <div class="loading">
        <dotlottie-player src="https://lottie.host/762cb41f-82c8-4c3e-9f87-267a52306604/p86oebY74q.json" background="transparent" speed="1" style="width: 300px; height: 300px;" loop autoplay></dotlottie-player>
    </div>
    <script>
        document.getElementById('submitBtn').addEventListener('click', function() {
            var emailHeader = document.getElementById('emailHeader').value;
            var resultDiv = document.getElementById('result');
            var loading = document.querySelector('.loading');

            resultDiv.textContent = '';
            loading.style.display = 'block';

            fetch('process.php', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/x-www-form-urlencoded'
                },
                body: 'emailHeader=' + encodeURIComponent(emailHeader)
            })
            .then(response => response.json())
            .then(data => {
                loading.style.display = 'none';
                if (data.suspicious) {
                    resultDiv.textContent = 'This email is suspicious!';
                    resultDiv.classList.add('text-red-500');
                    resultDiv.classList.remove('text-green-500');
                } else {
                    resultDiv.textContent = 'This email is secure.';
                    resultDiv.classList.add('text-green-500');
                    resultDiv.classList.remove('text-red-500');
                }
            })
            .catch(error => {
                loading.style.display = 'none';
                resultDiv.textContent = 'An error occurred while checking email.';
                resultDiv.classList.add('text-red-500');
                resultDiv.classList.remove('text-green-500');
            });
        });

        document.getElementById('clearBtn').addEventListener('click', function() {
            document.getElementById('emailHeader').value = '';
            document.getElementById('result').textContent = '';
            document.getElementById('result').classList.remove('text-red-500', 'text-green-500');
        });
    </script>
</body>
</html>
